import { Box, Grid, Typography } from "@mui/material";


export default function Footer(){
    return(
        <Box>
            <Grid container spacing={2} justifyContent={"center"}>
                <Grid item md={6} lg={4}>
                    <Typography variant="body1">About us</Typography>
                </Grid>

            </Grid>
        </Box>
    )
}
